import React from 'react';
import Menu from '../Menu/Menu';

const Header = props => {

 const {menuData} = props;

 console.log(props);

  return (
      <header className="header">
        <div className="wrapper">
          <div className="d-flex">
		   <Menu menu={menuData} menuState={this.state.isOpen}/>
           <button className={`ml-auto burger ${this.state.isOpen ? '':'burger_active'}`} onClick={this.burgerState}
           >&times;</button>
          </div>
        </div>
        </header>
  )
}
export default Header;
